import React, { Component } from "react";
import Header from "../components/Header"
import Footer from "../components/Footer"

const Home = () => {
  return 
    <div style='margin:0'>
      <Header />
      This is Home
      <br />-<br />-<br />-<br />-<br />-<br />-<br />-<br />-<br />-<br />-<br />-<br />-<br />-<br />-<br />-<br />-<br />-<br />-<br />-<br />-<br />-<br />-<br />-<br />-<br />-<br />-<br />-<br />-<br />-<br />-<br />-<br />-<br />-<br />-<br />-<br />-<br />-<br />-<br />End
      <Footer />
    </div>
    ;
};

export default Home;
